import React from 'react';
import appColor from '../../constants.js';

import './home.css';


function Home() {

    return (
      <div className="homePage">
        <div className="homeHeader">
            <Header />
            <div> Header</div>
        </div>
        <div className="homeContent">
            <div> Content</div>
        </div>
      </div>
    );
  }

  export default Home;
